import React from "react";
import Card from "../../componants/card/Card";
import Title from "../../componants/common/Title";
import styles from "../../style/common/card.module.css";

function Expensive() {
  const tshirts = [
    {
      src: "/toy-images/10.png",
      title: "Bearbrick x Mastermind",
      desc: "₹12,30,823.39",
    },
    {
      src: "/toy-images/11.png",
      title: "SYSTUMM T-Shirt (Lilac)",
      desc: "₹799.00",
    },
    {
      src: "/toy-images/12.png",
      title: "DESTROYER T-shirt (Black)",
      desc: "₹799.00",
    },
    {
      src: "/toy-images/13.png",
      title: "Typographic Print Loose Fit T-Shirt",
      desc: "₹799.00",
    },
  ];

  return (
    <div>
      <Title title="Expensive-Toy's" />
      <div className={styles.map3}>
        {tshirts.map((value, index) => {
          return (
            <Card
              key={index}
              src={value.src}
              title={value.title}
              desc={value.desc}
            />
          );
        })}
      </div>
    </div>
  );
}

export default Expensive;
